"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Pelvic muscle (Kegel) exercises (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/pelvic-muscle-kegel-exercises-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H21681565\">",
"      <span class=\"h1\">",
"       What are pelvic muscle exercises?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Pelvic muscle exercises are exercises that strengthen the muscles that control the flow of urine and bowel movements. These exercises are also known as &ldquo;Kegel&rdquo; exercises. They can help keep you from leaking urine, gas, or bowel movements, if leaks are a problem for you. They can also help with a condition that affects women called &ldquo;pelvic organ prolapse.&rdquo; In women who have pelvic organ prolapse, the organs in the lower belly drop down and press against or bulge into the vagina.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H21681572\">",
"      <span class=\"h1\">",
"       How do I learn how to do Kegel exercises?",
"      </span>",
"      &nbsp;&mdash;&nbsp;First ask your doctor or nurse how to do them right. He or she can help you get started. &nbsp;",
"     </p>",
"     <p>",
"      You will need to learn which muscles to tighten. It is sometimes hard to figure out the right muscles.",
"     </p>",
"     <p>",
"      A woman might learn to do Kegel exercises by:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Putting a finger inside her vagina and squeezing the muscles around her finger; or",
"       </li>",
"       <li>",
"        Pretending that she is sitting on a marble and has to pick up the marble using her vagina",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      A man might learn to do Kegels by tightening his butt muscles as if he were holding back gas.",
"     </p>",
"     <p>",
"      Both men and women can also learn to do Kegel exercises by stopping and starting the flow of urine. If you do this, make sure to do this only once or twice to figure out the correct muscles. Some doctors think you should not do this at all, because if you get in the habit of doing it, it could damage your bladder.",
"     </p>",
"     <p>",
"      No matter how you learn to do Kegel exercises, the important thing to know is that the muscles involved are not in your belly or your thighs.",
"     </p>",
"     <p>",
"      After you learn which muscles to tighten, you can do the exercises in any position (sitting in a chair or lying down). You do not need to do them while you are in the bathroom.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H21681579\">",
"      <span class=\"h1\">",
"       How often should I do the exercises?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Do the exercises 2 to 3 times a day, every day. Each time, flex your muscles about 10 times, and hold them tight for a few seconds each time you tighten. Keep up this routine for at least 4 or 5 months. You will probably see results, but it might take a little time. &nbsp;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H21681586\">",
"      <span class=\"h1\">",
"       How do Kegel exercises help?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Kegel exercises can help:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Reduce urine leaks in people who have &ldquo;stress incontinence,&rdquo; which means they leak urine when they cough, laugh, sneeze, or strain",
"       </li>",
"       <li>",
"        Control sudden urges to urinate that happen to people with &ldquo;urge incontinence&rdquo;",
"       </li>",
"       <li>",
"        Control the release of gas or bowel movements",
"       </li>",
"       <li>",
"        Reduce pressure or bulging in the vagina caused by pelvic organ prolapse. (If you have a bulge in the vagina, see your doctor or nurse to find out the cause.)",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Kegel exercises might also reduce urine leaks in men who have had surgery to treat prostate cancer or an enlarged prostate.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H21681653\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
