var title_f10_60_11212="Features of acute pancreatitis";
var content_f10_60_11212=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F68378&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F68378&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Clinical, laboratory, and imaging findings in acute pancreatitis",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_left\">",
"        Clinical",
"       </td>",
"       <td>",
"        Acute",
"upper abdominal pain radiating to the back with nausea and",
"vomiting, relieved with sitting or leaning forward; epigastric",
"tenderness and distention",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_left\" colspan=\"1\" rowspan=\"13\">",
"        Biochemical",
"       </td>",
"       <td class=\"sublist1_start\">",
"        Increased serum and urinary levels of pancreatic enzymes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Amylase, pancreatic isoamylase",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Lipase, co-lipase",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Carboxylester lipase, phospholipase",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Carboxypeptidase",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Trypsin, trypsinogen-2",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Increased serum levels of nonenzymatic pancreatic secretion",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Pancreatitis-associated protein",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Trypsinogen activation peptide",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Other serum markers",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        C-reactive protein",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Tumor necrosis factor",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Polymorphonuclear elastase",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_left\" colspan=\"2\" rowspan=\"1\">",
"        Radiologic",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Plain film of the abdomen",
"       </td>",
"       <td>",
"        Normal; small bowel ileus; \"sentinel\" loop; dilated transverse colon",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        CT scan, MRI",
"       </td>",
"       <td>",
"        Swelling",
"of pancreas; areas of necrosis; peripancreatic inflammation; acute",
"fluid collections; pseudocyst; abscess; hemorrhage into and",
"surrounding areas of pancreas",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_left\">",
"        Surgical/histologic",
"       </td>",
"       <td>",
"        At laparotomy",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
