var title_f10_60_11214="Braden scale for predicting pressure sore risk";
var content_f10_60_11214=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F68532&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F68532&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Braden scale for predicting pressure sore risk*",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1\">",
"       Sensory perception",
"      </td>",
"      <td class=\"subtitle1\">",
"       Moisture",
"      </td>",
"      <td class=\"subtitle1\">",
"       Activity",
"      </td>",
"      <td class=\"subtitle1\">",
"       Mobility",
"      </td>",
"      <td class=\"subtitle1\">",
"       Nutrition",
"      </td>",
"      <td class=\"subtitle1\">",
"       Friction &amp; shear",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Ability to respond meaningfully to pressure-related discomfort",
"      </td>",
"      <td>",
"       Degree to which skin is exposed to moisture",
"      </td>",
"      <td>",
"       Degree of physical activity",
"      </td>",
"      <td>",
"       Ability to change and control body position",
"      </td>",
"      <td>",
"       Usual food intake pattern",
"      </td>",
"      <td>",
"       &nbsp;",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_left\">",
"       1. Completely limited",
"      </td>",
"      <td class=\"subtitle2_left\">",
"       1. Constantly moist",
"      </td>",
"      <td class=\"subtitle2_left\">",
"       1. Bedfast",
"      </td>",
"      <td class=\"subtitle2_left\">",
"       1. Completely immobile",
"      </td>",
"      <td class=\"subtitle2_left\">",
"       1. Very poor",
"      </td>",
"      <td class=\"subtitle2_left\">",
"       1. Problem",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       <p>",
"        Unresponsive (does not moan, flinch, or grasp) to painful stimuli, due to diminished level of consciousness or sedation",
"       </p>",
"       <p>",
"        <strong>",
"         OR",
"        </strong>",
"       </p>",
"       <p>",
"        Limited ability to feel pain over most of body",
"       </p>",
"      </td>",
"      <td class=\"indent1\">",
"       Skin is kept moist almost constantly by perspiration, urine, etc. Dampness is detected every time patient is moved or turned.",
"      </td>",
"      <td class=\"indent1\">",
"       Confined to bed",
"      </td>",
"      <td class=\"indent1\">",
"       Does not make even slight changes in body or extremity position without assistance",
"      </td>",
"      <td class=\"indent1\">",
"       <p>",
"        Never eats a complete meal. Rarely eats more than 1/3 of any food offered. Eats 2 servings or less of protein (meat or dairy products) per day. Takes fluids poorly. Does not take a liquid dietary supplement.",
"       </p>",
"       <p>",
"        <strong>",
"         OR",
"        </strong>",
"       </p>",
"       <p>",
"        Is NPO and/or maintained on clear liquids or IV's for more than 5 days",
"       </p>",
"      </td>",
"      <td class=\"indent1\">",
"       Requires moderate to maximum assistance in moving. Complete lifting without sliding against sheets is impossible. Frequently slides down in bed or chair, requiring frequent repositioning with maximum assistance. Spasticity, contractures or agitation leads to almost constant friction.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_left\">",
"       2. Very limited",
"      </td>",
"      <td class=\"subtitle2_left\">",
"       2. Very moist",
"      </td>",
"      <td class=\"subtitle2_left\">",
"       2. Chairfast",
"      </td>",
"      <td class=\"subtitle2_left\">",
"       2. Very limited",
"      </td>",
"      <td class=\"subtitle2_left\">",
"       2. Probably inadequate",
"      </td>",
"      <td class=\"subtitle2_left\">",
"       2. Potential problem",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       <p>",
"        Responds only to painful stimuli",
"       </p>",
"       <p>",
"        Cannot communicate discomfort except by moaning or restlessness",
"       </p>",
"       <p>",
"        <strong>",
"         OR",
"        </strong>",
"       </p>",
"       <p>",
"        Has a sensory impairment which limits the ability to feel pain or discomfort over 1/2 of body",
"       </p>",
"      </td>",
"      <td class=\"indent1\">",
"       Skin is often, but not always moist. Linen must be changed at least once a shift.",
"      </td>",
"      <td class=\"indent1\">",
"       Ability to walk severely limited or non-existent. Cannot bear own weight and/or must be assisted into chair or wheelchair.",
"      </td>",
"      <td class=\"indent1\">",
"       Makes occasional slight changes in body or extremity position but unable to make frequent or significant changes independently",
"      </td>",
"      <td class=\"indent1\">",
"       <p>",
"        Rarely eats a complete meal and generally eats only about 1/2 of any food offered. Protein intake includes only 3 servings of meat or dairy products per day. Occasionally will take a dietary supplement.",
"       </p>",
"       <p>",
"        <strong>",
"         OR",
"        </strong>",
"       </p>",
"       <p>",
"        Receives less than optimum amount of liquid diet or tube feeding",
"       </p>",
"      </td>",
"      <td class=\"indent1\">",
"       Moves feebly or requires minimum assistance. During a move skin probably slides to some extent against sheets, chair, restraints or good position in chair or bed most of the time but occasionally slides down.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_left\">",
"       3. Slightly limited",
"      </td>",
"      <td class=\"subtitle2_left\">",
"       3. Occasionally moist",
"      </td>",
"      <td class=\"subtitle2_left\">",
"       3. Walks occasionally",
"      </td>",
"      <td class=\"subtitle2_left\">",
"       3. Slightly limited",
"      </td>",
"      <td class=\"subtitle2_left\">",
"       3. Adequate",
"      </td>",
"      <td class=\"subtitle2_left\">",
"       3. No apparent problem",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       <p>",
"        Responds to verbal commands, but cannot always communicate discomfort or the need to be turned",
"       </p>",
"       <p>",
"        <strong>",
"         OR",
"        </strong>",
"       </p>",
"       <p>",
"        Has some sensory impairment which limits ability to feel pain or discomfort in 1 or 2 extremities",
"       </p>",
"      </td>",
"      <td class=\"indent1\">",
"       Skin is occasionally moist, requiring an extra linen change approximately once a day",
"      </td>",
"      <td class=\"indent1\">",
"       Walks occasionally during day, but for very short distances, with or without assistance. Spends majority of each shift in bed or chair.",
"      </td>",
"      <td class=\"indent1\">",
"       Makes frequent though slight changes in body or extremity position independently",
"      </td>",
"      <td class=\"indent1\">",
"       <p>",
"        Eats over half of most meals. Eats a total of 4 servings of protein (meat, dairy products) per day. Occasionally will refuse a meal, but will usually take a supplement when offered.",
"       </p>",
"       <p>",
"        <strong>",
"         OR",
"        </strong>",
"       </p>",
"       <p>",
"        Is on a tube feeding or TPN regimen which probably meets most of nutritional needs",
"       </p>",
"      </td>",
"      <td class=\"indent1\">",
"       Moves in bed and in chair independently and has sufficient muscle strength to lift up completely during move. Maintains good position in bed or chair.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_left\">",
"       4. No impairment",
"      </td>",
"      <td class=\"subtitle2_left\">",
"       4. Rarely moist",
"      </td>",
"      <td class=\"subtitle2_left\">",
"       4. Walks frequently",
"      </td>",
"      <td class=\"subtitle2_left\">",
"       4. No limitation",
"      </td>",
"      <td class=\"subtitle2_left\">",
"       4. Excellent",
"      </td>",
"      <td class=\"subtitle2_left\" rowspan=\"2\">",
"       &nbsp;",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       <p>",
"        Responds to verbal commands",
"       </p>",
"       <p>",
"        Has no sensory deficit which would limit ability to feel or voice pain or discomfort",
"       </p>",
"      </td>",
"      <td class=\"indent1\">",
"       Skin is usually dry, linen only requires changing at routine intervals",
"      </td>",
"      <td class=\"indent1\">",
"       Walks outside room at least twice a day and inside room at least once every two hours during waking hours",
"      </td>",
"      <td class=\"indent1\">",
"       Makes major and frequent changes in position without assistance",
"      </td>",
"      <td class=\"indent1\">",
"       Eats most of every meal. Never refuses a meal. Usually eats a total of 4 or more servings of meat and dairy products. Occasionally eats between meals. Does not require supplementation.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       <strong>",
"        Score:",
"       </strong>",
"       __________",
"      </td>",
"      <td>",
"       <strong>",
"        Score:",
"       </strong>",
"       __________",
"      </td>",
"      <td>",
"       <strong>",
"        Score:",
"       </strong>",
"       __________",
"      </td>",
"      <td>",
"       <strong>",
"        Score:",
"       </strong>",
"       __________",
"      </td>",
"      <td>",
"       <strong>",
"        Score:",
"       </strong>",
"       __________",
"      </td>",
"      <td>",
"       <strong>",
"        Score:",
"       </strong>",
"       __________",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * To calculate the Braden scale score, rank the patient in each of the subscales; sensory perception, mobility, activity, moisture, nutrition and friction and shear. Add the six subscale scores to yield a total Braden scale score. Lower scores are associated with a higher risk of developing pressure scores. A score of 18 or less indicates high risk. See www.bradenscale.com.",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission. Copyright &copy; 1988 Barbara Braden and Nancy Bergstrom.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
